import React, { useEffect, useState } from "react";
import API from "../../api/api";
import "./AdminPanel.css";

export default function Dashboard() {
    const [stats, setStats] = useState({
        totalProducts: 0,
        totalUsers: 0,
        totalOrders: 0,
        totalSales: 0,
    });

    const [recentOrders, setRecentOrders] = useState([]);

    useEffect(() => {
        loadDashboardData();
    }, []);

    async function loadDashboardData() {
        try {
            const productRes = await API.get("/products");
            const usersRes = await API.get("/users");
            const ordersRes = await API.get("/orders");

            const orders = ordersRes.data || [];
            const sales = orders.reduce((sum, order) => sum + (order.totalAmount || 0), 0);

            setStats({
                totalProducts: productRes.data.products?.length || productRes.data.length,
                totalUsers: usersRes.data.length,
                totalOrders: orders.length,
                totalSales: sales,
            });

            setRecentOrders(orders.slice(0, 5)); // last 5 orders
        } catch (err) {
            console.error(err);
        }
    }

    return (
        <div className="dashboard">
            <h1 className="dashboard-title">Admin Dashboard</h1>

            {/* Stats Cards */}
            <div className="cards">
                <div className="card">
                    <h3>Products</h3>
                    <p>{stats.totalProducts}</p>
                </div>
                <div className="card">
                    <h3>Users</h3>
                    <p>{stats.totalUsers}</p>
                </div>
                <div className="card">
                    <h3>Orders</h3>
                    <p>{stats.totalOrders}</p>
                </div>
                <div className="card">
                    <h3>Total Sales</h3>
                    <p>₹ {stats.totalSales}</p>
                </div>
            </div>

            {/* Recent Orders Table */}
            <h2 className="recent-title">Recent Orders</h2>
            <table className="recent-table">
                <thead>
                    <tr>
                        <th>Order ID</th>
                        <th>User</th>
                        <th>Total (₹)</th>
                        <th>Status</th>
                        <th>Date</th>
                    </tr>
                </thead>

                <tbody>
                    {recentOrders.length > 0 ? (
                        recentOrders.map((order) => (
                            <tr key={order._id}>
                                <td>{order._id.slice(-6)}</td>
                                <td>{order.user?.name || "Unknown"}</td>
                                <td>{order.totalAmount}</td>
                                <td>
                                    <span className={`status ${order.status}`}>
                                        {order.status}
                                    </span>
                                </td>
                                <td>{new Date(order.createdAt).toLocaleDateString()}</td>
                            </tr>
                        ))
                    ) : (
                        <tr>
                            <td colSpan="5" style={{ textAlign: "center" }}>
                                No recent orders
                            </td>
                        </tr>
                    )}
                </tbody>
            </table>
        </div>
    );
}
